Friends are getting faster and, well, I’m getting slower! Nearing third trimester(!) and have recently felt a big shift in how my body & how running feels. Grateful to still be running & working out, absolutely love feeling our baby moving around inside of me, humbled & amazed by the things our bodies can do, while simultaneously reallyy missing crushing workouts & gearing up for races with friends. I think @abbey_dags said it best in one of her recent posts:

“For anyone else pregnant, injured, or for some reason unable to move in a way you desire - it’s possible to feel BOTH a longing for what your body can normally do, & gratitude / respect for where it is (& the different way it’s *creating*) right now. The tension isn’t wrong🤍” 

In the interim of not racing, feeling lots of vicarious joy & inspiration through others pouring it out there! 
Special shoutouts to:
@em_sisson_ setting multiple American Records in the Houston Half !🙌👏
@mollyhuddle running an incredibly baller half marathon nine months postpartum!🔥
@nautrackfieldxc having an awesome first indoor track meet of the year!
And my teammates running super speedy up at 7000ft!

#FlyHumanFly #GrowBabyGrow

There’s a reason they call Boston “Title Town”! 🏆

@teambaa takes 1-3 in the USATF 5km championships in NYC with @andrearodenfels taking the victory in 15:22.

New mom @rachschneid18 takes 2nd in 15:26! 👩‍👧

@bethanyhasz outleans @keiradamato by 1 second for third in 15:27.

